INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(103,	1,	'Hand Tied',	'&lt;p&gt;Our beautiful bouquets of hand-tied flowers are a floral delight and can be made in an array of seasonal flowers, vibrant colours and scented delights.&amp;nbsp; Why not add a box of chocolates to really make this gift extra special?&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Hand Tied',	'Hand Tied',	'Hand Tied'),
(102,	1,	'Everlasting Rose Hat Box',	'&lt;p&gt;For when you want a flower gift that is different to the usual flower bouquet. Samantha’s Flowers has a range of beautifully hand-arranged gift baskets that make perfect birthday presents, anniversary gifts or just a little thank you gift.&lt;br&gt;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Everlasting Rose Hat Box',	'Everlasting Rose Hat Box',	'Everlasting Rose Hat Box'),
(101,	1,	'Basket Arrangments ',	'&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;For when you want a flower gift that is different to the usual flower bouquet. Samantha’s Flowers has a range of beautifully hand-arranged gift baskets that make perfect birthday presents, anniversary gifts or just a little thank you gift.&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Basket Arrangments ',	'Basket Arrangments ',	'Basket Arrangments '),
(100,	1,	'Party Balloons &amp; Decor',	'&lt;p&gt;Samantha’s can supply colourful, vibrant balloons for any occasion. Birthdays, Anniversaries, Weddings and parties are all made more fun with balloons which can also be personalised. Our specially-created balloon bouquets , garlands, arches and clouds come in a range of colours and themes to suit all occasions - all you need to do is choose your favourite arrangement&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Party Balloons &amp; Decor',	'Party Balloons &amp; Decor',	'Party Balloons &amp; Decor'),
(98,	1,	'Gates of Heaven',	'',	'Gates',	'Gates',	'Gates'),
(99,	1,	'Arrangements',	'&lt;p&gt;Samantha’s Flowers has a wide range of Flower Arrangements in both fresh and silk flowers designed to suit a variety of homes and interiors. Our Flower Arrangements can be customised if you like a particular colour scheme, shape or size in mind.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Talk to our team and we will produce the Flower Arrangements to desire.&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Arrangements',	'Arrangements',	'Arrangements'),
(97,	1,	'Funeral Sheaves',	'',	'Funeral Sheaves',	'Funeral Sheaves',	'Funeral Sheaves'),
(96,	1,	'Cushions',	'&lt;p&gt;Traditional Pillows and cushions are available in 4 sizes. Samantha can design your tribute with a pleated ribbon edge of your choice with a matching corsage in the corner of the cushion or pillow. The corsages are a mixture of seasonal blooms which may include roses freesias and carnations.&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Sample Category',	'Cushions',	'Cushions'),
(95,	1,	'Coffin Sprays and Crosses',	'&lt;p&gt;Funeral Cross&lt;/p&gt;&lt;p&gt;Funeral Crosses are often the primary tribute at a funeral and represent extremely personal sentiments and feelings. These tributes are typically chosen by immediate family or close friends. Our Funeral Crosses are available in a variety of beautiful colours, shapes, and sizes that will suit most budgets.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;* 3 working days’ notice is required when ordering this funeral flower arrangement&lt;/p&gt;&lt;p&gt;Tributes can be delivered directly to the funeral directors, you can also specify a delivery time&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Coffin Sprays and Crosses',	'Coffin Sprays and Crosses',	'Coffin Sprays and Crosses'),
(94,	1,	'Bespoke',	'&lt;p&gt;Samantha’s Flowers take pride in designing and creating beautiful and detailed specialist tributes, unique to every person, a fitting way to say your final goodbye to departed loved ones.&lt;/p&gt;&lt;p&gt;If you can\'t find exactly what you\'re looking for then please do get in touch to discuss in more detail or arrange a one to one consultation where we will be happy to offer help and advice.&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Bespoke',	'Bespoke',	'Bespoke'),
(105,	1,	'Silk Arrangments',	'&lt;p&gt;Our beautiful bouquets of hand-tied flowers are a floral delight and can be made in an array of seasonal flowers, vibrant colours, and scented delights.&amp;nbsp; Why not add a box of chocolates to really make this gift extra special?&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Silk Arrangments',	'Silk Arrangments',	'Silk Arrangments'),
(106,	1,	'Vase Arrangments',	'&lt;p&gt;Our flowers in vases for homes, offices and restaurants come in an attractive vase and in a wide range of styles and size.&lt;/p&gt;&lt;p&gt;Talk to our team on 01708 732555 and we will create the design you desire.&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Vase Arrangments',	'Vase Arrangments',	'Vase Arrangments'),
(107,	1,	'Hearts',	'&lt;p&gt;Samantha’s can supply colourful, vibrant balloons for any occasion. Birthdays, Anniversaries, Weddings and parties are all made more fun with balloons which can also be personalised. Our specially-created balloon bouquets come in a range of colours and themes to suit all occasions - all you need to do is choose your favourite arrangement.&amp;nbsp;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Hearts',	'Hearts',	'Hearts'),
(108,	1,	'Kiss',	'&lt;p&gt;Our Kiss tribute comes with your choice of focal spray and ribbon edge colour and available in 3 sizes.&lt;/p&gt;&lt;p&gt;These can be made as a single, double, triple or multiple kisses. The 12” and 14” kisses can be fastened to a standing bar together.&lt;/p&gt;&lt;p&gt;We can personalise each kiss colour individually if siblings are sending one each to a parent, or if a group are sending one each to a friend, they will then be affixed to one bar to form one large tribute.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Please call us to discuss this option. Samantha’s Flowers 01708 735222.&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Kiss',	'Kiss',	'Kiss'),
(104,	1,	'Hat Box (Fresh or Silk)',	'&lt;p&gt;Our beautiful bouquets of hand-tied flowers are a floral delight and can be made in an array of seasonal flowers, vibrant colours and scented delights.&amp;nbsp; Why not add a box of chocolates to really make this gift extra special?&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Hat Box (Fresh or Silk)',	'Hat Box (Fresh or Silk)',	'Hat Box (Fresh or Silk)'),
(109,	1,	'Letters',	'&lt;p&gt;Funeral letters and number tributes are often seen at funerals and are usually dedicated to a particular family member as a main tribute from the closely bereaved. Choose a single letter, word or number personal to you and Samantha’s Flowers will create a beautiful arrangement in your colour theme with delicate floral detailing.&lt;/p&gt;&lt;p&gt;Prices from:&lt;/p&gt;&lt;p&gt;£30 per letter based; £40 per letter Open; £50 per letter Roses&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'Letters',	'Letters',	'Letters'),
(110,	1,	'Posy',	'&lt;p&gt;A beautiful funeral posy skilfully arranged can be the most beautiful of floral tributes.INSERT INTO `oc_category_path` (`category_id`, `path_id`, `level`) VALUES
