INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(5,	1,	'Terms &amp; Conditions',	'&lt;p&gt;\r\n	Terms &amp;amp; Conditions&lt;/p&gt;\r\n',	'Terms &amp; Conditions',	'',	''),
(3,	1,	'Privacy Policy',	'&lt;p&gt;\r\n	Privacy Policy&lt;/p&gt;\r\n',	'Privacy Policy',	'',	''),
(6,	1,	'Delivery Information',	'&lt;p style=&quot;font-family: Lora, serif; margin-bottom: 14px; font-size: 22px; text-align: center; letter-spacing: 1px;&quot;&gt;&lt;/p&gt;&lt;p style=&quot;font-family: Lora, serif; margin-bottom: 14px; font-size: 22px; text-align: center; letter-spacing: 1px;&quot;&gt;&lt;/p&gt;&lt;ol&gt;&lt;/ol&gt;&lt;p&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 14px;&quot;&gt;&lt;font face=&quot;Lora, serif&quot;&gt;&lt;span style=&quot;font-size: 22px;&quot;&gt;Collier Row | Romford | Havering | Chadwell Heath | Seven Kings | Goodmayes | Harold Wood | Harold Hill | Hornchurch | Upminster | Brentwood | Chigwell | Ongar | Hainault | Barkingside | Dagenham | Ilford | Abridge | Barking | Loughton | Chigwell | Rainham | Stapleford Abbots | Elm Park | Gants&amp;nbsp; Hill | Woodford |&lt;/span&gt;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;',	'Delivery Information',	'',	''),
(4,	1,	'About Us',	'&lt;p&gt;\r\n	&lt;img src=&quot;https://opencart-447800-1402268.cloudwaysapps.com/image/catalog/FLOWER WEBSITE/SHOP/SAM SHOP.jpg&quot; style=&quot;width: 870px;&quot;&gt;About Us&lt;/p&gt;&lt;p style=&quot;margin-bottom: 15px; line-height: 1.5; font-family: Karla, sans-serif; font-size: 14px; color: rgb(85, 85, 85);&quot;&gt;Samantha’s Flowers is a family-run business founded by local florist Samantha Job who has served the people of Collier Row, Romford for more than two decades. Inspired by her love of flowers, Samantha creates&amp;nbsp;imaginative and&amp;nbsp;memorable flower arrangements for all occasions.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 15px; line-height: 1.5; font-family: Karla, sans-serif; font-size: 14px; color: rgb(85, 85, 85);&quot;&gt;Samantha believes that the finest, freshest flowers produce the most impressive displays and she and her expertly trained&amp;nbsp;staff are here&amp;nbsp;to help our customers find the design and choice that is perfect for them.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 15px; line-height: 1.5; font-family: Karla, sans-serif; font-size: 14px; color: rgb(85, 85, 85);&quot;&gt;Samantha’s Flowers is experienced in all aspects of floral design including; weddings, funerals, christenings, birthday celebrations, hand-ties and bouquets from the simplest and the most elaborate tokens of love.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 15px; line-height: 1.5; font-family: Karla, sans-serif; font-size: 14px; color: rgb(85, 85, 85);&quot;&gt;Samantha’s Florist hopes that our online presentation gives you a small taste of what we offer, but come and see us in person so we can show you how we arrange creations of flowers and plants, whether as a gift or for your home.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 15px; line-height: 1.5; font-family: Karla, sans-serif; font-size: 14px; color: rgb(85, 85, 85);&quot;&gt;We also stock a wide range of seasonal giftware, candles and objet d\'art to adorn any house or garden.&lt;/p&gt;&lt;p style=&quot;margin-bottom: 15px; line-height: 1.5; font-family: Karla, sans-serif; font-size: 14px; color: rgb(85, 85, 85);&quot;&gt;We are open seven days a week and offer a free, local delivery service.&lt;/p&gt;\r\n',	'About Us',	'',	'');
