(44,	'Contact Form + Map',	'basel_content',	'{\"save\":\"stay\",\"name\":\"Contact Form + Map\",\"status\":\"1\",\"b_setting\":{\"title\":\"0\",\"title_pl\":{\"1\":\"\"},\"title_m\":{\"1\":\"\"},\"title_b\":{\"1\":\"\"},\"custom_m\":\"1\",\"mt\":\"\",\"mr\":\"\",\"mb\":\"\",\"ml\":\"\",\"fw\":\"0\",\"block_bg\":\"0\",\"bg_color\":\"#222222\",\"block_bgi\":\"0\",\"bg_par\":\"0\",\"bg_pos\":\"left top\",\"bg_repeat\":\"no-repeat\",\"block_bgv\":\"0\",\"bg_video\":\"\",\"block_css\":\"0\",\"css\":\"\"},\"bg_image\":\"\",\"c_setting\":{\"fw\":\"0\",\"block_css\":\"1\",\"css\":\"border:10px solid #f9f9f9;\\r\\npadding:40px 3.5% 0px 3.5%;\",\"nm\":\"0\",\"eh\":\"0\"},\"columns\":{\"1\":{\"w\":\"col-sm-6\",\"w_sm\":\"col-xs-1\",\"w_md\":\"col-sm-1\",\"w_lg\":\"col-md-1\",\"type\":\"html\",\"data7\":\"vertical-top text-left\",\"data1\":{\"1\":\"&lt;div class=&quot;flower-about-block left&quot;&gt;\\r\\n&lt;h4&gt;\\r\\n&lt;b&gt;CONTACT FORM&lt;\\/b&gt;\\r\\n&lt;\\/h4&gt;\\r\\n&lt;p style=&quot;color:#555555;margin-bottom:35px;&quot;&gt;\\r\\nIf you have any questions or would like to get touch with us by email, here\\u2019s our access point.\\r\\n&lt;\\/p&gt;\\r\\n[contact_form]\\r\\n&lt;\\/div&gt;\\r\\n\"}},\"2\":{\"w\":\"col-sm-6\",\"w_sm\":\"col-xs-1\",\"w_md\":\"col-sm-1\",\"w_lg\":\"col-md-1\",\"type\":\"html\",\"data7\":\"vertical-top text-left\",\"data1\":{\"1\":\"&lt;div class=&quot;flower-about-block right&quot;&gt;\\r\\n&lt;h4&gt;&lt;b&gt;ABOUT OUR SHOP&lt;\\/b&gt;&lt;\\/h4&gt;\\r\\n&lt;p style=&quot;color:#555555;&quot;&gt;\\r\\nSamantha\\u2019s Flowers is a family-run business founded by local florist Samantha who has served the people of Collier Row, Romford for more than two decades. Inspired by her love of flowers, Samantha creates\\u00a0imaginative and\\u00a0memorable flower arrangements for all occasions. \\r\\n&lt;\\/p&gt;\\r\\n&lt;p style=&quot;color:#555555;&quot;&gt;\\r\\nSamantha believes that the finest, freshest flowers produce the most impressive displays and she and her expertly trained\\u00a0staff are here\\u00a0to help our customers find the design and choice that is perfect for them.\\r\\n&lt;\\/p&gt;\\r\\n&lt;p style=&quot;color:#555555;&quot;&gt;\\r\\nSamantha\\u2019s Flowers is experienced in all aspects of floral design including; weddings, funerals, christenings, birthday celebrations, hand-ties and bouquets from the simplest and the most elaborate tokens of love.\\u00a0\\r\\n&lt;\\/p&gt;\\r\\n&lt;p style=&quot;color:#555555;&quot;&gt;\\r\\nSamantha\\u2019s Florist hopes that our online presentation gives you a small taste of what we offer, but come and see us in person so we can show you how we arrange creations of flowers and plants, whether as a gift or for your home.\\r\\n&lt;\\/p&gt;\\r\\n&lt;p style=&quot;color:#555555;&quot;&gt;\\r\\nWe also stock a wide range of seasonal giftware, candles and objet d\'art to adorn any house or garden.\\r\\n&lt;\\/p&gt;\\r\\n&lt;p style=&quot;color:#555555;&quot;&gt;\\r\\nWe are open six days a week but can also arrange Sunday deliveries.\\r\\n&lt;\\/p&gt;\\r\\n[map]\\r\\n\\r\\n&lt;div class=&quot;row&quot;&gt;\\r\\n\\r\\n&lt;div class=&quot;col-sm-6&quot;&gt;\\r\\n&lt;div class=&quot;promo-style-3&quot;&gt;\\r\\n&lt;span class=&quot;icon&quot;&gt;&lt;i class=&quot;icon-phone&quot;&gt;&lt;\\/i&gt;&lt;\\/span&gt;\\r\\n&lt;a href=&quot;tel: +44 1708735222&quot;&gt;01708735222&lt;\\/a&gt;\\r\\n&lt;\\/div&gt;\\r\\n&lt;\\/div&gt;\\r\\n\\r\\n&lt;div class=&quot;col-sm-6&quot;&gt;\\r\\n&lt;div class=&quot;promo-style-3&quot;&gt;\\r\\n&lt;span class=&quot;icon&quot;&gt;&lt;i class=&quot;icon-envelope&quot;&gt;&lt;\\/i&gt;&lt;\\/span&gt;\\r\\n&lt;a href = &quot;mailto:samanthasflowers32@gmail.com\\r\\n&quot;&gt;samanthasflowers32@gmail.com\\r\\n&lt;\\/p&gt;&lt;\\/a&gt;\\r\\n&lt;\\/div&gt;\\r\\n&lt;\\/div&gt;\\r\\n\\r\\n&lt;div class=&quot;col-sm-6&quot;&gt;\\r\\n&lt;div class=&quot;promo-style-3&quot;&gt;\\r\\n&lt;span class=&quot;icon&quot;&gt;&lt;i class=&quot;icon-cursor&quot;&gt;&lt;\\/i&gt;&lt;\\/span&gt;\\r\\n&lt;a href=&quot;https:\\/\\/www.google.com\\/maps\\/place\\/Samantha+Flowers\\/@51.5990974,0.1596769,17z\\/data=!3m1!4b1!4m5!3m4!1s0x47d8a361d579b6cd:0x2a0282eaf836d218!8m2!3d51.5990974!4d0.1618656&quot; target=&quot;_blank&quot;&gt;32 Collier Row Rd, Collier Road&lt;br&gt;\\r\\nRomford RM5 3NX&lt;\\/a&gt;\\r\\n&lt;\\/div&gt;\\r\\n&lt;\\/div&gt;\\r\\n\\r\\n&lt;div class=&quot;col-sm-6&quot;&gt;\\r\\n&lt;div class=&quot;promo-style-3&quot;&gt;\\r\\n&lt;span class=&quot;icon&quot;&gt;&lt;i class=&quot;icon-rocket&quot;&gt;&lt;\\/i&gt;&lt;\\/span&gt;\\r\\n&lt;a href= &quot;http:\\/\\/opencart-447800-1402268.cloudwaysapps.com\\/index.php?route=information\\/information&amp;information_id=6&quot; target=&quot;_blank&quot;&gt;Delivery Information&lt;\\/p&gt;&lt;\\/a&gt;\\r\\n&lt;\\/div&gt;\\r\\n&lt;\\/div&gt;\\r\\n\\r\\n&lt;\\/div&gt;\\r\\n&lt;\\/div&gt;\"}}}}'),
