(195,	1,	'KISS 0001',	'&lt;p&gt;We can personalize each kiss colour individually if siblings are sending one each to a parent, or if a group is sending one each to a friend, they will then be affixed to one bar to form one large tribute.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Please call us to discuss this option. Samantha’s Flowers 01708 735222.&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;',	'KISS 0001',	'KISS 0001',	'Our Kiss tribute comes with your choice of focal spray and ribbon edge colour and available in 3 sizes.\r\nThese can be made as a single, double, triple or multiple kisses. The 12” and 14” kisses can be fastened to a standing bar together.\r\n\r\n',	'KISS 0001'),
